import React from 'react';
import { Carousel, Card, Row, Col } from 'antd';
import { HomeOutlined, EditOutlined } from '@ant-design/icons';
import { useNavigate } from 'react-router-dom';

const Welcome = () => {
  const navigate = useNavigate();

  const images = [
    { id: 1, text: 'Hoşgeldin', image: 'https://via.placeholder.com/800x400?text=Hoşgeldin' },
    { id: 2, text: 'Ev ekleyebilirsin', image: 'https://via.placeholder.com/800x400?text=Ev+ekleyebilirsin' },
    { id: 3, text: 'Düzenleyebilirsin', image: 'https://via.placeholder.com/800x400?text=Düzenleyebilirsin' },
  ];

  return (
    <div style={{ textAlign: 'center', padding: '50px' }}>
      <Carousel autoplay autoplaySpeed={7000}>
        {images.map((img) => (
          <div key={img.id}>
            <div style={{
              height: '300px',
              backgroundImage: `url(${img.image})`,
              backgroundSize: 'cover',
              backgroundPosition: 'center',
              display: 'flex',
              justifyContent: 'center',
              alignItems: 'center',
              color: 'white',
              fontSize: '24px'
            }}>
              {img.text}
            </div>
          </div>
        ))}
      </Carousel>
      <div style={{ marginTop: '20px' }}>
        <Row gutter={[16, 16]} justify="center">
          <Col span={8}>
            <Card
              hoverable
              onClick={() => navigate('/property-input')}
              style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '150px' }}
            >
              <HomeOutlined style={{ fontSize: '48px' }} />
            </Card>
          </Col>
          <Col span={8}>
            <Card
              hoverable
              onClick={() => navigate('/property-edit')}
              style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '150px' }}
            >
              <EditOutlined style={{ fontSize: '48px' }} />
            </Card>
          </Col>
        </Row>
      </div>
    </div>
  );
};

export default Welcome;
